export const pageStates = {
  Space: {
    state: space,
    setState: setSpace,
    class: "space",
    title: "Space",
  },
  "Our Planet": {
    state: earth,
    setState: setEarth,
    class: "earth",
    title: "Our Planet",
  },
};
